import Navbar from "../components/Navbar";
import Page from "../components/Page";
import "../styles/style.css";

function MyApp({ Component, pageProps }) {
    return (
        <Page>
            <Meta />
            <Navbar />
            <MainContainer>
                <Component {...pageProps} />
            </MainContainer>
        </Page>
    );
}

export default MyApp;
